package main

import "fmt"

func firstUniqChar(s string) byte {
	var arr [26]int
	for _, v := range []rune(s) {
		arr[v-'a'] += 1
	}

	for _, v := range s {
		if arr[v-'a'] == 1 {
			return uint8(v)
		}
	}

	return ' '
}

func main() {
	a := firstUniqChar(test())
	fmt.Println(string(a))
}

